    player_id UUID REFERENCES player(id), 
    achievement_name VARCHAR(50) NOT NULL, 
    date_achieved DATE NOT NULL 
);

CREATE TABLE friends ( 
    player_id UUID REFERENCES player(id), 
    friend_id UUID REFERENCES player(id), 
    PRIMARY KEY (player_id, friend_id) 
);

CREATE TABLE messages ( 
    id UUID PRIMARY KEY, 
    sender_id UUID REFERENCES player(id), 
    receiver_id UUID REFERENCES player(id), 
    message_text TEXT NOT NULL, 
    date_sent TIMESTAMP NOT NULL 
);

### STATEMENT

SELECT p.username, f.friend_id FROM player p JOIN friends f ON p.id = f.friend_id WHERE p.username = 'Hank'
